import './contacts.css'
import React from 'react'

export default function Contacts() {
    return (
        <div className='contacts'>
            <img
            src={require('../../img/contacts-pic.png')}
            alt='contacts img' 
            className='contacts__bg-img'/>
        </div>
    )
}
